import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
// ... other imports

const TrainerDashboard = () => {
  return (
    <div>
       <nav>
         <Link to="/TrainerDashboard/TrainerDashboard">Profile</Link>
         <Link to="/TrainerDashboard/TrainerClients">Clients</Link>
         <Link to="/TrainerDashboard/TrainerSchedule">Schedule</Link>
         <Link to="/TrainerDashboard/TrainerWorkouts">Workouts</Link>
      </nav>
      <Routes>
        <Route path="TrainerDashboard" element={<TrainerDashboard />} />
        <Route path="TrainerClients" element={<TrainerClients />} />
        <Route path="TrainerSchedule" element={<TrainerSchedule />} />
        <Route path="TrainerWorkouts" element={<TrainerWorkouts />} />
        <Route path="/" element={<TrainerDashboard />} />
      </Routes>
    </div>
  );
};

// ... other component definitions ...

export default TrainerDashboard;
